import "./App.css";
import Header from "./components/Header.js";
import Container from "react-bootstrap/Container";

function App() {
  return (
    <>
      <Header />
      <Container className="mt-3">
        <div className="d-flex justify-content-between align-items-center"></div>
      </Container>
    </>
  );
}

export default App;
